import React from "react"
import { BrowserRouter, Route, Switch } from "react-router-dom"

import SignUp from "../components/signup"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/signup" component={SignUp} />
        </Switch>
      </BrowserRouter>
      <h1>Book store</h1>
      <a href="/signup">Sign up</a>
    </div>
  );
}

export default App;
